import { createTheme } from "@mui/material";

export const theme = createTheme({
  palette: {
    background: {
      default: "#CC978E",
    },
    text: {
      primary: "#ffffff",
    },
  },
  typography: {
    h1: {
      fontSize: "80px",
    },
  },
});
